contract Mint is ERC721Enumerable, Ownable {
    using Strings for uint256;
    using SafeMath for uint256;
    using Counters for Counters.Counter;

    // Constants
    string public tokenExtension = ".json";
    string public imageExtension = ".png";
    uint256 public cost = 0 ether; // price for each mint NFT

    // Supply
    uint256 public mintReward = 0;
    uint256 public constant maxSupply = 100; // total NFT
    uint256 public lastSupply = maxSupply;
    uint256 public maxMintAmount = 1;

    // Reflection
    uint256 public reflectionBalance;
    uint256 public totalDividend;

    // Lists
    uint256[maxSupply] public remainingIds;
    mapping(uint256 => uint256) public lastDividendAt;
    mapping(uint256 => address) public minters;

    // Params
    bool public paused = true;
    bool public mintOnce = false;
    string private _baseTokenURI;
    string private _baseImageURI;
    address private _wallet;

    // Addresses
    address public DexRouter = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    address public RewardToken = 0x7919f2F49102d7f2d7d9e9935e26BbD727711B73;
    address public FeeReceiver = 0x3c3cb22D555523bb85f2a76CBFF8ACBBb54332dc;

    //Contracts
    IUniswapV2Router02 public router;
    IERC20 public token;

    struct MintedNftStruct {
        uint256 id;
        address buyer;
        uint256 cost;
        string imageURL;
        uint256 timestamp;
    }

    struct MintedAddressStruct {
        address minter;
    }

    MintedNftStruct[] mintedNft;
    MintedAddressStruct[] mintedAddress;

    // Constructor
    constructor(
        string memory name,
        string memory symbol,
        string memory baseTokenURI,
        string memory baseImageURI
    ) ERC721(name, symbol) {
        _baseTokenURI = baseTokenURI;
        _baseImageURI = baseImageURI;
        _wallet = msg.sender;
        router = IUniswapV2Router02(DexRouter);
        token = IERC20(RewardToken);
    }

    //URI Handling
    function _baseURI() internal view virtual override returns (string memory) {
        return _baseTokenURI;
    }

    // update
    function updateBaseTokenURI(string memory baseTokenURI_) public onlyOwner {
        _baseTokenURI = baseTokenURI_;
    }

    function updateBaseImageURI(string memory baseImageURI_) public onlyOwner {
        _baseImageURI = baseImageURI_;
    }

    function updateCost(uint256 _newCost) public onlyOwner {
        cost = _newCost;
    }

    function updatemaxMintAmount(uint256 _newmaxMintAmount) public onlyOwner {
        maxMintAmount = _newmaxMintAmount;
    }

    function updateTokenExtension(string memory _newBaseExtension) public onlyOwner {
        tokenExtension = _newBaseExtension;
    }

    function updateImageExtension(string memory _newImageExtension) public onlyOwner {
        imageExtension = _newImageExtension;
    }

    function pause(bool _state) public onlyOwner {
        paused = _state;
    }

    function updateMintOnce(bool mintOnce_) public onlyOwner {
        mintOnce = mintOnce_;
    }

    function updateRewardToken(address _newRewardToken) public onlyOwner {
        RewardToken = _newRewardToken;
        token = IERC20(RewardToken);
    }

    function setDexRouter(address _newDexRouter) public onlyOwner {
        DexRouter = _newDexRouter;
        router = IUniswapV2Router02(DexRouter);
    }

    function upateFeeReceiver(address _newFeeReceiver) public onlyOwner {
        FeeReceiver = _newFeeReceiver;
    }

    // Minting
    function mint(uint256 _mintAmount) public payable {
        // require
        require(!paused, "Minting has not started yet");
        require(_mintAmount > 0, "You have to mint at least one");
        require(
            _mintAmount <= maxMintAmount,
            string(abi.encodePacked("You can only mint ", maxMintAmount.toString(), " at a time"))
        );
        require(lastSupply >= _mintAmount, "The collection is sold out");

        if (msg.sender != owner()) {
            require(msg.value >= cost * _mintAmount, "Total cost isn't match");
        }

        if (mintOnce) {
            require(!isAddressMinted(msg.sender), "This address has already minted token");
        }

        // Minting
        for (uint256 i = 1; i <= _mintAmount; i++) {
            uint256 amount = msg.value / _mintAmount;

            // Mint for caller
            uint256 tokenId = _randomMint(msg.sender);
            // Split cost
            handleMintReward(amount);

            _updateMintedList(msg.sender, tokenId, amount);
        }

        mintedAddress.push(MintedAddressStruct(msg.sender));
    }

    function isAddressMinted(address minter) public view returns (bool) {
        for (uint i = 0; i < mintedAddress.length; i++) {
            if (mintedAddress[i].minter == minter) {
                return true;
            }
        }
        return false;
    }

    function getAllNFTs() public view returns (MintedNftStruct[] memory) {
        return mintedNft;
    }

    function toImage(uint256 tokenId) internal view returns (string memory) {
        string memory currentBaseURI = _baseImageURI;
        return
            bytes(currentBaseURI).length > 0
                ? string(abi.encodePacked(currentBaseURI, tokenId.toString(), imageExtension))
                : "";
    }

    // Give a random NFT to a contest winner
    function randomGiveaway(address _winner, uint256 _amount) external onlyOwner {
        // Checks
        require(_winner != address(0), "Zero address");
        require(_amount > 0, "You have to mint at least one");
        require(lastSupply != 0, "The collection is sold out");
        // Mint random NFTs for a winner
        for (uint256 i = 1; i <= _amount; i++) {
            uint256 tokenId = _randomMint(_winner);

            _updateMintedList(_winner, tokenId, _amount);
        }
    }

    function _updateMintedList(address receiver, uint256 tokenId, uint256 amount) private {
        string memory imageURL = toImage(tokenId);
        uint256 timestamp = block.timestamp;

        mintedNft.push(MintedNftStruct(tokenId, receiver, amount, imageURL, timestamp));
    }

    // Random mint
    function _randomMint(address _target) internal returns (uint256) {
        // Get Random id to mint
        uint256 _index = _getRandom() % lastSupply;
        uint256 _realIndex = getValue(_index) + 1;
        // Reduce supply
        lastSupply--;
        // Replace used id by last
        remainingIds[_index] = getValue(lastSupply);
        // Mint
        _safeMint(_target, _realIndex);
        // Save Original minters
        minters[_realIndex] = msg.sender;
        // Save dividend
        lastDividendAt[_realIndex] = totalDividend;

        return _realIndex;
    }

    // Mint for reserved spots
    function _regularMint() internal returns (uint256) {
        // Get Actual id to mint
        uint256 _index = totalSupply();
        uint256 _realIndex = getValue(_index) + 1;
        // Reduce supply
        lastSupply--;
        // Replace used id by last
        remainingIds[_index] = getValue(lastSupply);
        // Mint
        _safeMint(msg.sender, _realIndex);
        // Save Original minters
        minters[_realIndex] = msg.sender;
        // Save dividend
        lastDividendAt[_realIndex] = totalDividend;
        return _realIndex;
    }

    // Get Token List
    function getTokenIds(address _owner) public view returns (uint256[] memory) {
        // Count owned Token
        uint256 ownerTokenCount = balanceOf(_owner);
        uint256[] memory tokenIds = new uint256[](ownerTokenCount);
        // Get ids of owned Token
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokenIds;
    }

    // Return compiled Token URI
    function tokenURI(uint256 _id) public view virtual override returns (string memory) {
        require(_exists(_id), "URI query for nonexistent token");
        string memory currentBaseURI = _baseURI();
        return
            bytes(currentBaseURI).length > 0
                ? string(abi.encodePacked(currentBaseURI, _id.toString(), tokenExtension))
                : "";
    }

    // Reflections
    function handleMintReward(uint256 _amount) private {
        // Split payment
        uint256 mintShare = _amount.mul(mintReward).div(100);
        uint256 devShare = _amount.sub(mintShare);
        // Save dividend for community
        reflectDividend(mintShare);
        // Send owner share
        payable(FeeReceiver).transfer(devShare);
    }

    // Add dividend
    function reflectDividend(uint256 _amount) private {
        reflectionBalance = reflectionBalance.add(_amount);
        totalDividend = totalDividend.add((_amount.div(totalSupply())));
    }

    function reflectToOwners() public payable {
        reflectDividend(msg.value);
    }

    function getReflectionBalances(address _owner) public view returns (uint256) {
        uint256 count = balanceOf(_owner);
        uint256 total = 0;
        for (uint256 i = 0; i < count; i++) {
            uint256 tokenId = tokenOfOwnerByIndex(_owner, i);
            total = total.add(getReflectionBalance(tokenId));
        }
        return total;
    }

    function getReflectionBalance(uint256 tokenId) public view returns (uint256) {
        return totalDividend.sub(lastDividendAt[tokenId]);
    }

    function claimRewardsTokens() public {
        uint256 count = balanceOf(msg.sender);
        uint256 initialBalanceOf = token.balanceOf(address(this));
        uint256 balance = 0;
        for (uint256 i = 0; i < count; i++) {
            uint256 tokenId = tokenOfOwnerByIndex(msg.sender, i);
            balance = balance.add(getReflectionBalance(tokenId));
            lastDividendAt[tokenId] = totalDividend;
        }
        // Covert Balance to Tokens
        address[] memory path = new address[](2);
        path[0] = router.WETH();
        path[1] = RewardToken;

        router.swapExactETHForTokensSupportingFeeOnTransferTokens{ value: balance }(
            0,
            path,
            address(this),
            block.timestamp
        );

        uint256 finalBalanceOf = token.balanceOf(address(this));
        uint256 tokens = finalBalanceOf.sub(initialBalanceOf);
        token.transfer(msg.sender, tokens);
    }

    // Utils

    // Get value from a remaining id node
    function getValue(uint256 _index) internal view returns (uint256) {
        if (remainingIds[_index] != 0) return remainingIds[_index];
        else return _index;
    }

    // Create a random id for minting
    function _getRandom() internal view returns (uint256) {
        return uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp, lastSupply)));
    }
}

